def create_client():

  credentials = GoogleCredentials.get_application_default()
  ml_service = discovery.build(
      'ml', 'v1beta1', credentials=credentials)
  return ml_service


def get_prediction(ml_service, project, model_name,
	mmsis, features, timestamps):
  request_dict = make_request_json(mmsis, features, timestamps)
  body = {'instances': [request_dict]}

  # This request will use the default model version.
  parent = 'projects/{}/models/{}'.format(project, model_name)
  request = ml_service.projects().predict(name=parent, body=body)
  result = request.execute()
  return result


def parse_args():
  """Handle the command line arguments.

  Returns:
    Output of argparse.ArgumentParser.parse_args.
  """

  parser = argparse.ArgumentParser()
  parser.add_argument('-o', '--output', default='gfwrequest.json',
                      help='Output file to write encoded images to.')
  # parser.add_argument('inputs', nargs='+', type=argparse.FileType('r'),
  #                     help='A list of .jpg or .jpeg files to serialize into a '
  #                     'request json')

  args = parser.parse_args()
  return args

def strip_first_elt(l):
	return [i[1:] for i in l]

def truncate_or_pad(l, n):
    return l[:n] + [0]*(n-len(l))

def make_request_json(mmsis, features, timestamps):
  """..."""

  featurelist_size = 512

  # image.save(resized_handle, format='JPEG')
  # encoded_contents = base64.b64encode(resized_handle.getvalue())

  # remove the timestamps from the features arrays...
  features_sized = strip_first_elt(truncate_or_pad(features, featurelist_size))
  timestamps_sized = truncate_or_pad(timestamps, featurelist_size)
  itimestamps_sized = [int(i) for i in timestamps_sized]

  print(len(itimestamps_sized))
  print(len(features_sized))

  request_json = {
      'mmsis': mmsis,
      'features': [features_sized],
      'timestamps': itimestamps_sized
      # 'features': features_sized,
      # 'timestamps': itimestamps_sized
    }

  return request_json

def create_request_file(jsonstr, output_json_file):
    with open(output_json_file, 'w') as ff:
      row = json.dumps(jsonstr)
      ff.write(row)
      ff.write('\n')


def main():
  print("in main...")
  args = parse_args()
  jsonstr = make_request_json(mmsis, features, timestamps)
  create_request_file(jsonstr, args.output)
  ml_client = create_client()
  result = get_prediction(ml_client, 'aju-vtests2',
                          'gfw',
                          mmsis, features, timestamps)
  print("result: %s" % result)

if __name__ == '__main__':
  main()
